INSERT INTO coding_questions (question_id, explain, language, base_code, stdinout, max_exec_time, model_answer, judge_format, mandatory_words, mini_lines) VALUES
(316, '<p><span style=\"font-size:10.5pt\"><span style=\"font-family:&quot;ＭＳ 明朝&quot;,serif\">次のフローチャートをＣ言語で記述し，実行せよ。<br>※正誤チェックは機械的に処理されるので以下に気を付けてください．<br>\r\n・出力の最後には改行を入れてください</span></span></p>\r\n\r\n<img src=\"data:image/png;base64,\">\r\n\r\n', 'C', '', '{"example1": {"in": "", "out": ""}}', 5, '#include <stdio.h>\r\nint main(void)\r\n{\r\n	char val;\r\n	scanf(\"%c\",&val);\r\n	if(val == \"A\"){\r\n		printf(\"当たり\\n\");\r\n	}\r\n	return 0;\r\n}', '完全一致', '#include', 9),
(317, '<p style=\"text-align:justify\"><span style=\"font-size:10.5pt\"><span style=\"font-family:&quot;ＭＳ 明朝&quot;,serif\">次のフローチャートをＣ言語で記述し，実行せよ。</span></span></p>\r\n\r\n<img src=\"data:image/png;base64,\">\r\n', 'C', '', '{"example1": {"in": "", "out": ""}}', 5, '#include <stdio.h>\r\nint main(void)\r\n{\r\n	int tsuki;\r\n	tsuki = 1;\r\n	while( tsuki <= 12){\r\n		printf(\"%d月\\n\",tsuki);\r\n		tsuki = tsuki + 1;\r\n	}\r\n	return 0;\r\n}', '完全一致', '#include', 10),
(318, '<p><span style=\"font-size:10.5pt\"><span style=\"font-family:&quot;ＭＳ 明朝&quot;,serif\">次のフローチャートをＣ言語で記述し，実行せよ。</span></span></p>\r\n\r\n<img src=\"data:image/png;base64,\">\r\n', 'C', '', '{"example1": {"in": "", "out": ""}}', 5, '#include <stdio.h>\r\nint main(void)\r\n{\r\n	int kazu;\r\n	scanf(\"%d\",&kazu);\r\n	while( kazu < 50 ){\r\n		printf(\"%d\\n\",kazu);\r\n		kazu = kazu + 1;\r\n	}\r\n	return 0;\r\n}', '完全一致', '#include', 10),
(319, '<p>次の処理内容を読み，Ｃ言語で記述し，実行して結果を確認しなさい。<br>数値を１から10まで順番に出力する。</p>\r\n\r\n<img src=\"data:image/png;base64,\">\r\n', 'C', '', '{"example1": {"in": "", "out": ""}}', 5, '#include <stdio.h>\r\nint main(void)\r\n{\r\n	int kazu;\r\n	kazu = 1;\r\n	while( kazu<=10 ){\r\n		printf(\"%d \",kazu);\r\n		kazu = kazu + 1;\r\n	}\r\n	printf(\"\\n\");\r\n	return 0;\r\n}', '完全一致', '#include', 11),
(320, '<p>次の処理内容を読み，Ｃ言語で記述し，実行して結果を確認しなさい。<br>数値を１から10まで出力する。ただし，５まで出力した時点で一度改行する。<br>※正誤チェックは機械的に処理されるので以下に気を付けてください．<br>・5と10の後ろには改行が付きます</p>\r\n<p><br />\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '', '{"example1": {"in": "", "out": ""}}', 5, '#include <stdio.h>\r\nint main(void)\r\n{\r\n	int kazu;\r\n	kazu = 1;\r\n	while( kazu<=10 ){\r\n		printf(\"%d \",kazu);\r\n		if( kazu == 5 ){\r\n			printf(\"\\n\");\r\n		}\r\n		kazu = kazu + 1;\r\n	}\r\n	printf(\"\\n\");\r\n	return 0;\r\n}', '完全一致', '#include', 14),
(321, '<p>次の処理内容を読み，Ｃ言語で記述し，実行して結果を確認しなさい。<br>数値を2つ入力し，大きい数値，小さい数値の順に出力する。</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '', '{"example1": {"in": "", "out": ""}}', 5, '#include <stdio.h>\r\nint main(void)\r\n{\r\n	int val1, val2;\r\n	scanf(\"%d\",&val1);\r\n	scanf(\"%d\",&val2);\r\n	if(val1 > val2){\r\n		printf(\"大 %d\\n\",val1);\r\n		printf(\"小 %d\\n\",val2);\r\n	}\r\n	else{\r\n		printf(\"大 %d\\n\",val2);\r\n		printf(\"小 %d\\n\",val1);\r\n	}\r\n	return 0;\r\n}', '完全一致', '#include', 15),
(322, '<p>次の処理内容を読み，Ｃ言語で記述し，実行して結果を確認しなさい。<br>文字を一つ入力し，その文字が &#39;x&#39; でない間「BAD!」と出力し，次の文字を入力させる。&#39;x&#39; が入力されたら「GOOD!」と出力して処理を終了する。<br>正誤チェックは機械的に処理されるので以下に気を付けてください．<br>・出力の最後には改行を必ず入れてください<br>・入力はscanf(\" %c\",a);という様に%の前に半角スペースを入れてください.</p><p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '', '{"example1": {"in": "", "out": ""}}', 5, '#include <stdio.h>\r\nint main(void)\r\n{\r\n	char moji;\r\n	scanf(\"%c\",&moji);\r\n	while(moji!=\"x\"){\r\n	    printf(\"BAD!\\n\");\r\n	    scanf(\" %c\",&moji);\r\n	}\r\n	printf(\"GOOD!\\n\");\r\n}', '完全一致', '#include', 5),
(329, '<p>フローチャートのとおりプログラムを書きなさい．入出力例と一致することを確認しなさい</p>\r\n\r\n<p><img src=\"data:image/png;base64,\">\r\n</p>\r\n', 'C', '', '{"example1": {"in": "", "out": ""}}', 5, '#include <stdio.h>\r\n\r\nint main(void)\r\n{\r\n	int a,b;\r\n	\r\n	scanf(\"%d\",&a);\r\n	\r\n	if(a <= 3){\r\n		b = a*2;\r\n	}\r\n	else{\r\n		b = a-3;\r\n	}\r\n	\r\n	printf(\"%d\\n\",b);\r\n	\r\n	return 0;\r\n}', '完全一致', '#include', 13),
(330, '<p>フローチャートのとおりプログラムを書きなさい．入出力例と一致することを確認しなさい</p><p><img src=\"data:image/png;base64,\">\r\n</p>\r\n', 'C', '', '{"example1": {"in": "", "out": ""}}', 5, '#include <stdio.h>\r\n\r\nint main(void)\r\n{\r\n	int x,y,z;\r\n	\r\n	scanf(\"%d\",&x);\r\n	scanf(\"%d\",&y);\r\n	\r\n	if(x > y){\r\n		z = x-y;\r\n	}\r\n	else{\r\n		z = y-x;\r\n	}\r\n	\r\n	printf(\"%d\\n\",z);\r\n	\r\n	return 0;\r\n}', '完全一致', '#include', 14),
(331, '<p>フローチャートのとおりプログラムを書きなさい．入出力例と一致することを確認しなさい</p><p><img src=\"data:image/png;base64,\">\r\n</p>\r\n', 'C', '', '{"example1": {"in": "", "out": ""}}', 5, '#include <stdio.h>\r\nint main(void)\r\n{\r\n	int a;\r\n	scanf(\"%d\",&a);\r\n	if(a < 0){\r\n		a = a * (-1);\r\n	}\r\n	if(a < 10){\r\n	}else{\r\n		a = a-10;\r\n	}\r\n	printf(\"%d\\n\",a);\r\n	return 0;\r\n}', '完全一致', '#include', 14),
(332, '<p><span style=\"font-size:10.5pt\"><span style=\"font-family:&quot;ＭＳ 明朝&quot;,serif\">処理の説明とフローチャートをもとにc言語で記述しなさい。</span></span></p>\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '', '{"example1": {"in": "", "out": ""}}', 5, '#include <stdio.h>\r\n\r\nint main(void)\r\n{\r\n	int a,b;\r\n	scanf(\"%d\",&a);\r\n	if(a<5){\r\n		b=a*3;\r\n	}\r\n	else{\r\n		b=a*2;\r\n	}\r\n	printf(\"%d\\n\",b);\r\n	return 0;\r\n}', '完全一致', '#include', 14),
(333, '<p>処理の説明とフローチャートをもとにc言語で記述しなさい。</p><p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '', '{"example1": {"in": "", "out": ""}}', 5, '#include <stdio.h>\r\n\r\nint main(void)\r\n{\r\n	int x,y,L,S;\r\n	scanf(\"%d %d\",&x,&y);\r\n	if(x>y){\r\n		L=x;\r\n		S=y;\r\n	}\r\n	else{\r\n		L=y;\r\n		S=x;\r\n	}\r\n	printf(\"大：%d\\n小：%d\\n\",L,S);\r\n	return 0;\r\n}', '完全一致', '#include', 15),
(334, '<p>フローチャートのとおりプログラムを書きなさい．入出力例と一致することを確認しなさい</p>\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '', '{"example1": {"in": "", "out": ""}}', 5, '#include <stdio.h>\r\n\r\nint main(void)\r\n{\r\n	int i;\r\n	\r\n	i = 3;\r\n	\r\n	while(i>=0){\r\n		i = i-1;\r\n	}\r\n\r\n	printf(\"%d\\n\",i);\r\n	return 0;\r\n}', '完全一致', '#include', 11),
(335, '<p>フローチャートのとおりプログラムを書きなさい．入出力例と一致することを確認しなさい</p>\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '', '{"example1": {"in": "", "out": ""}}', 5, '#include <stdio.h>\r\n\r\nint main(void)\r\n{\r\n	int i;\r\n	\r\n	i = 3;\r\n	\r\n	while(i>=0){\r\n		i = i-1;\r\n		printf(\"%d\\n\",i);\r\n	}\r\n\r\n	return 0;\r\n}', '完全一致', '#include', 10),
(336, '<p>フローチャートのとおりプログラムを書きなさい．入出力例と一致することを確認しなさい</p>\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '', '{"example1": {"in": "", "out": ""}}', 5, '#include <stdio.h>\r\n\r\nint main(void)\r\n{\r\n	int j,S;\r\n\r\n	j = 1;\r\n	S = 0;\r\n	\r\n	while(j<4){\r\n		S = S+j;\r\n		j = j+1;\r\n	}\r\n\r\n	printf(\"%d\\n\",S);\r\n\r\n	return 0;\r\n}\r\n', '完全一致', '#include', 13),
(337, '<p>フローチャートのとおりプログラムを書きなさい．入出力例と一致することを確認しなさい</p>\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '', '{"example1": {"in": "", "out": ""}}', 5, '#include <stdio.h>\r\n\r\nint main(void)\r\n{\r\n	int j,S;\r\n\r\n	j = 1;\r\n	S = 0;\r\n	\r\n	while(j<=4){\r\n		S = S+j;\r\n		j = j+1;\r\n	}\r\n\r\n	printf(\"%d\\n\",S);\r\n\r\n	return 0;\r\n}', '完全一致', '#include', 13),
(338, '<p>フローチャートのとおりプログラムを書きなさい．入出力例と一致することを確認しなさい</p><p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '', '{"example1": {"in": "", "out": ""}}', 5, '#include <stdio.h>\r\n\r\nint main(void)\r\n{\r\n	int j,S;\r\n\r\n	j = 1;\r\n	S = 0;\r\n	\r\n	while(j<4){\r\n		j = j+1;\r\n		S = S+j;\r\n	}\r\n\r\n	printf(\"%d\\n\",S);\r\n\r\n	return 0;\r\n}\r\n', '完全一致', '#include', 13),
(339, '<p>フローチャートのとおりプログラムを書きなさい．入出力例と一致することを確認しなさい</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '', '{"example1": {"in": "", "out": ""}}', 5, '#include <stdio.h>\r\n\r\nint main(void)\r\n{\r\n	int j,S;\r\n\r\n	j = 1;\r\n	S = 0;\r\n	\r\n	while(j<=4){\r\n		j = j+1;\r\n		S = S+j;\r\n	}\r\n\r\n	printf(\"%d\\n\",S);\r\n\r\n	return 0;\r\n}', '完全一致', '#include', 13),
(348, '<p>処理の説明とフローチャートをもとにプログラムを作成しなさい。</p><p><img src=\"data:image/png;base64,\"></p>\r\n', 'C', '', '{"example1": {"in": "", "out": ""}}', 5, '#include <stdio.h>\r\n\r\nint main(void)\r\n{\r\n	int i;\r\n	i = 1;\r\n	\r\n	while(i<5){\r\n		printf(\"%d\\n\",i);\r\n		i = i+1;\r\n	}\r\n\r\n	return 0;\r\n}', '完全一致', '#include', 11),
(349, '<p>処理の説明とフローチャートをもとに、プログラムを作成しなさい。</p><p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '', '{"example1": {"in": "", "out": ""}}', 5, '#include <stdio.h>\r\n\r\nint main(void)\r\n{\r\n	int i,S;\r\n	\r\n	i = 1;\r\n	S = 0;\r\n	\r\n	while(i<5){\r\n		S = S + i;\r\n		i = i + 1;\r\n	}\r\n	printf(\"総和:%d\\n\",S);\r\n	\r\n	return 0;\r\n}', '完全一致', '#include', 12),
(350, '<p>処理の説明とフローチャートを参考にプログラムを作成しなさい。</p><p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '', '{"example1": {"in": "", "out": ""}}', 5, '#include <stdio.h>\r\n\r\nint main(void)\r\n{\r\n	int i,S,a;\r\n	S = 1;\r\n	i = 1;\r\n\r\n	scanf(\"%d\",&a);\r\n\r\n	while (i<5){\r\n		S = S * i;\r\n		i = i + 1;\r\n	}\r\n	printf(\"階乗: %d\\n\",S);\r\n\r\n	return 0;\r\n}', '完全一致', '#include', 13);